import React, { useState } from 'react';
import Page from './Page';

const App = () => {
    const numRows = 15;
    const numCols = 15;
    const [plateau, setPlateau] = useState(Array.from({ length: numRows }, () => Array(numCols).fill(0)));

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', width: '100vw', height: '100vh' }}>
            <div style={{ width: '70%', height: '70vh', overflow: 'hidden', border: '1px solid #ccc' }}>
                <Page numRows={numRows} numCols={numCols} plateau={plateau} setPlateau={setPlateau} />
            </div>
        </div>
    );
};

export default App;
